import './career.scss';
import Header from '../header/header';
import { useState, useEffect } from 'react';
import FadeIn from '../fadeIn/fadeIn';
import ServiceItem from '../serviceItem/serviceItem';
import { Link } from 'react-router-dom';
import Footer from '../footer/footer';

const Career = (): JSX.Element => {

    return (
        <>
            <div className="career">
                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 1000 1000" preserveAspectRatio="xMidYMid meet">
                    <defs>
                        <linearGradient>
                        <pattern id="smallGrid" width="8" height="8" patternUnits="userSpaceOnUse">
                            <path d="M 8 0 L 0 0 0 8" fill="none" stroke="gray" stroke-width="1" />
                        </pattern>
                        <pattern id="grid" width="80" height="80" patternUnits="userSpaceOnUse">
                            <rect width="80" height="80" fill="url(#smallGrid)" />
                            <path d="M 80 0 L 0 0 0 80" fill="none" stroke="#3700ff" stroke-width="1" />
                        </pattern>
                        </linearGradient>
                    </defs>
                    <rect width="100%" height="100%" fill="url(#grid)" />
                </svg>
            </div>
        </>
    );
}

export default Career;
